"""IDENTIFYING OUTLIERS 1"""

#calculating outliers
#zscore  = observation-mean/std
outliers = []
def defect_outliers(Dataa):
  threshold = 3
  mean = np.mean(Dataa)
  std = np.std(Dataa)
  for i in Dataa:
    z_score = (i-mean)/std
    if np.abs(z_score)>threshold:
      outliers.append(i)
  return outliers

outlier_pt=defect_outliers(Data_outlier['prevexp'])
outlier_pt

